console.clear();

var str = "";

var i,j;
var abc = "abcdefghijklmnopqrstuvwxyz";
var isFullyReacted;

function fullReaction(_str){
	if(_str == null || typeof _str == "undefined") _str = str;

	while(true){
		for(i=0;i<abc.length;i++){
			var r = new RegExp("["+abc[i].toUpperCase()+"]["+abc[i].toLowerCase()+"]|["+abc[i].toLowerCase()+"]["+abc[i].toUpperCase()+"]","g");
			_str = _str.replace(r,"");
		}

		isFullyReacted = true;
		for(i=0;i<abc.length;i++){
			var r = new RegExp("["+abc[i].toUpperCase()+"]["+abc[i].toLowerCase()+"]|["+abc[i].toLowerCase()+"]["+abc[i].toUpperCase()+"]","g");

			var m = _str.match(r);
			if(m == null || m.length == 0){}
			else{
				isFullyReacted = false;
				break;
			}
		}

		if(isFullyReacted){
			break;
		}
	}

	//outputString(_str);
	return _str.length;
}

function outputString(_str){
	if(_str == null || typeof _str == "undefined") _str = str;

	console.log(_str.length, _str);
	document.getElementById("out").innerHTML = "Length: "+_str.length+"<hr />"+_str;
}

function optimiseReact(){
	var l, mn = 1E99, mn_letter = "";
	for(var _i=0;_i<abc.length;_i++){
		var r2 = new RegExp("["+abc[_i]+"]","gi");
		var newStr = str.replace(r2,"");

		l = fullReaction(newStr);
		if(l<mn){
			mn = l;
			mn_letter = abc[_i];
		}
	}
	console.log(mn,mn_letter);
	//outputString(mn);
}
